const TaskStatistic = ({tasksStatistic}) => {
  const not_complete = tasksStatistic.filter((task)=>{
    if(task.status === 0) {
      return true
    } else {
      return false
    }
  })


  return (
    <div>
      Количество задач: {tasksStatistic.length}
      Количество невыполненных задач: {not_complete.length}
    </div>

  )

}

export default TaskStatistic
